INSERT INTO `hoteles` (`id`, `nombre`, `descripcion`, `idUser`, `archivo`) VALUES
(3, 'Sonesta', 'Este hotel refinado, situado en la ciudadela Zamora, se encuentra a 9 minutos a pie de la iglesia La Catedral y a 3 km del centro de la ciudad.  Las habitaciones son tradicionales y están equipadas con televisión de pantalla plana y Wi-Fi gratis. Las suites cuentan además con zona de estar y bañera de hidromasaje; las suites superiores disponen de muebles elegantes.', 37, 'SonestaHotel.png'),
(4, 'Gran Victoria', 'Este hotel elegante de la época colonial se encuentra a 2 minutos a pie del Museo del Banco Central, a 2 km del Museo de la Cultura Lojana y a 15 km de los límites del amplio Parque Nacional Podocarpus.  Las habitaciones son elegantes y se abren a un patio central. Están equipadas con muebles de madera cálidos y televisión de pantalla plana, minibar y Wi-Fi gratis. Las suites cuentan además con zona de descanso con sofá y algunas disponen de baño con bañera de hidromasaje.', 28, 'minGrandVictoria.png'),
(5, 'Zamorano Real Hotel', 'Este hotel moderno y elegante se encuentra a 5 minutos a pie de la catedral de Loja, de elaborado tallado, y a 1 km de la antigua puerta de la ciudad.  Las habitaciones son modernas y discretas. Están equipadas con televisión de pantalla plana, Wi-Fi gratis y servicio de habitaciones. Las habitaciones superiores disponen de balcón y bañera de hidromasaje; las suites cuentan con cocina básica.', 28, 'minZamorano.png'),
(6, 'Hotel Podocarpus', 'Este hotel sin pretensiones se encuentra en un barrio con cafeterías y restaurantes, a 2 minutos a pie del parque Simón Bolívar, a 5 de la catedral de Loja y a 8 del Museo de la Música.  Las habitaciones, decoradas con un estilo desenfadado, disponen de Wi‑Fi gratis, televisión por cable y baño.', 28, 'minPodocarpus.png'),
(7, 'Romar Royal Hotel', 'Este hotel sencillo, ubicado en una zona comercial repleta de tiendas y restaurantes, se encuentra a 2 km de la autopista E50, a 2 minutos a pie de Central Park y a 10 minutos a pie de la Puerta de la Ciudad, que cuenta con un museo, una cafetería y la ciudad. puntos de vista.  Las habitaciones tranquilas cuentan con acceso a Wi-Fi, TV de pantalla plana y caja fuerte, además de frigobar y utensilios para preparar té y café. Las suites incluyen salas de estar y cocinas básicas.', 28, 'minRomar.png'),
(13, 'Hotel Libertador', 'Este hotel tranquilo se encuentra en una calle céntrica y apacible, a 5 minutos a pie de una parada de autobús, a 3 minutos a pie del Museo del Banco Central y a 4 km del Parque Colinar Pucará.  Las habitaciones son discretas y tienen una decoración acogedora. Cuentan con Wi-Fi gratis y televisión. Algunas tienen capacidad para 3 personas y zona de descanso, mientras que las suites disponen de zona de estar independiente y decoración elegante.', 28, 'minLibertador.png');
INSERT INTO `lugares` (`id`, `nombre`, `descripcion`, `idUser`, `archivo`) VALUES
(3, 'Parque Nacional Podocarpus', 'El Parque Nacional Podocarpus es un parque nacional ubicado en las provincias de Loja y Zamora Chinchipe, en el sur oriente del Ecuador. Fue instaurado el 15 de diciembre de 1982. El Parque es una zona de megadiversidad y una zona de alto grado de endemismo debido a su ubicación entre sistemas biológicos diversos.​Se extiende sobre 146.280 hectáreas o 1.468,8 km².​ En las dos estribaciones de la Cordillera Oriental de Los Andes hasta las cuencas de los ríos Nangaritza, Numbala y Loyola. Cerca del 85 % del parque está en la provincia de Zamora Chinchipe y cerca del 15 % en la provincia de Loja. El parque nacional se estableció con el fin de proteger al bosque más grande de romerillos en el país, compuesto por tres especies del género Podocarpus, la única conífera nativa del Ecuador. Dentro del parque se ha desarrollado un medio biológico único, representando especialmente por la avifauna única en el área. El parque nacional Podocarpus alberga un complejo de más de 100 lagunas, una de las más conocidas son las Lagunas del Compadre. También hay cascadas, cañones y varias clases de mamíferos y plantas.', 37, 'parqueNacionalPodocarpus.jpg'),
(4, 'Parque Recreacional Jipiro', 'La Unidad Parque Recreacional Jipiro que en idioma palta significa, lugar de descanso, constituye una de las principales atracciones de Loja. Es considerado como único en el país debido a su composición. Una de sus características principales son los nueve Troncos etno-culturales representados con réplicas de las más destacadas expresiones arquitectónicas y culturales de la humanidad. En el Parque Jipiro se puede observar como la creatividad humana aprovechando la flora, fauna y la arquitectura de diversas civilizaciones, para ofrecer un acogedor parque náutico con laguna, cisnes, patos, escenario para eventos, botes, bares, restaurantes, canchas y espacios para camping.', 28, 'parqueJipiro.jpg'),
(5, 'Puerta de Entrada a la ciudad', 'Es la Puerta de Entrada a la ciudad, es un monumento arquitectónico, uno de los mayores atractivos de la ciudad de Loja. En su interior alberga un museo. Es la Puerta de Entrada a la ciudad, representa parte del Escudo de Loja, en el que se divisa un castillo medieval, por el cual se accede al centro de la ciudad. Construida en los años 1998–1999. Se dice que es una réplica del escudo de Loja. La entrada propiamente dicha, está conformada por el Puente Bolívar que pasa sobre el río Malacatos, un castillo y las esculturas de Don Quijote y su fiel compañero, Sancho.', 28, 'puertaEntradaCuidad.jpg'),
(6, 'Plaza de la Cultura', 'En el marco del Primer Festival Internacional de Artes Vivas de Loja 2016, el gobierno ecuatoriano inauguraró en la ciudad de Loja el Teatro Benjamín Carrión una de las obras más destacadas en favor de la cultura ecuatoriana con capacidad para 900 espectadores. Este espacio no solo albergará eventos de ópera, teatro, danza o ballet sino que además será escenario de uno de los pilares más fuerte de la actividad cultural de Loja: la música. El teatro también es la sede de la orquesta sinfónica de Loja. Además, cuenta con tecnología de punta y con todos los requerimientos de un teatro de talla mundial, por lo que ha sido catalogado como el escenario cultural más grande y mejor equipado del Ecuador.', 28, 'plazaCultura.jpg'),
(7, 'Parque Central', 'Es un parque donde se puede disfrutar de abundante vegetación, diferentes bancos para que los ecuatorianos y turistas puedan sentarse a descansar y es también un lugar para disfrutar durante el día y la noche. Dentro del parque merece la pena destacar un monumento en la zona del centro, recordando la figura del Dr. Bernardo Valdivieso de los Héroes, que ayudó mucho a la educación de Loja y a la libertad religiosa, además de fundar la Universidad Nacional de Loja en 1859, un monumento muy antiguo hecho en bronce. Este monumento en la plaza o Parque Central es uno de los iconos de la ciudad, un lugar ideal para fotografiarse y llevarse un recuerdo.', 28, 'parqueCentral.jpg'),
(11, 'Parque Lineal La Tebaida', 'El parque lineal La Tebaida se encuentra ubicado al sur de la ciudad de Loja, fue creado entre año de 1998 y 1999 en la administracion del Dr. José Bolívar Castillo, lleva el nombre de lineal ya que cuenta con varias áreas, como: senderos, canchas deportivas, juegos infantiles, kioskos donde se vende confitería, muro de escala, área para ejercitarse, espacios verdes para realizar actividades de fin de semana. Mide aproximadamente 3.5 km desde el puente del Centro Comercial \"Supermaxi\" hasta el puente de la Universidad Nacional de Loja, con una extensión de 6.4 hectáreas, brindando recreación a los turistas nacionales y extranjeros.', 28, 'parqueLinealTebaida.jpg');
